from typing import List


class Solution:
    def minDominoRotations(self, tops: List[int], bottoms: List[int]) -> int:
        n = len(tops)

        # it is either of these two since working number have to be on any
        # domino
        a, b = tops[0], bottoms[0]
        c_a_top, c_a_bot = 0, 0
        c_b_top, c_b_bot = 0, 0

        for idx in range(0, n):

            if a != -1:
                if tops[idx] != a and bottoms[idx] != a:
                    a = -1
                elif tops[idx] != a:
                    c_a_top += 1
                elif bottoms[idx] != a:
                    c_a_bot += 1

            if b != -1:
                if tops[idx] != b and bottoms[idx] != b:
                    b = -1
                elif tops[idx] != b:
                    c_b_top += 1
                elif bottoms[idx] != b:
                    c_b_bot += 1

        result = -1

        if a != -1:
            result = min(c_a_top, c_a_bot)

        if b != -1:
            b_result = min(c_b_top, c_b_bot)
            if result == -1 or b_result < result:
                result = b_result

        return result


